import React, { Component } from 'react'
import { Row, Col } from 'antd';
 class Brands extends Component {
    render() {
        return (
            <div className="col-24 sections section-2">
                <h1 className='title'>BRANDS WE WORK WITH</h1>
                <Row className="rowWidth"> 
                    <img src="https://lynagails-caters.s3-ap-southeast-1.amazonaws.com/uploads/Web_Stylegenie_Asia3_Partners.png" style={{width:'100%'}}/>
                </Row>
            </div>  
        )
    }
}
export default Brands
